import styles from './SignUp.module.css'
import TextBox from '../TextBox/TextBox'
import { useNavigate } from 'react-router-dom';
function SignUp()
{
    const navigate = useNavigate();
    const HandleLogin = () => {
        navigate('/');
    }
    return(
        <div className={styles.mainPage}>
        <div className={styles.pageHeader}>
            Welcome to <span className={styles.logo}>CoinBounce</span>
        </div>
        <TextBox type="text" placeholder="Enter your Name" />
        <TextBox type="password" placeholder="Enter your Phone Number" />
        <TextBox type="password" placeholder="Enter your Address" />
        <TextBox type="text" placeholder="Enter your Email" />
        <TextBox type="password" placeholder="Enter your Password" />
        <button onClick={HandleLogin} className={styles.LoginButton}>
            Create Account
        </button>
        </div>
    )
}

export default SignUp
